import { useSelector, useDispatch } from 'react-redux';

import { ReactElement } from 'react';
import { Data, FoodData, Discounts, Items, initialState } from '../Reducers/cartReducer';
import { cartReducer } from '../Reducers/cartReducer';
import { RootState } from '../Reducers';
import CartFood from './CartFood';

export default function CartList() {
  const dispatch = useDispatch();
  const { clickedFoods } = useSelector((store: RootState) => store.cartReducer);
  const { discounts } = useSelector((store: RootState) => store.cartReducer);
  const { count } = useSelector((store: RootState) => store.cartReducer);

  return (
    <>
    <div>cart list</div>
    <div>{
      clickedFoods.map((food: Items): ReactElement<CartFoodProps> => {
        const name = food.name;
        const price = food.price; // 1000단위 마다 ,를 붙여야 함
        return <CartFood key={name} name={name} price={price} />
      })
      }</div>
    </>
  )
}

export interface CartFoodProps {
  name: string;
  price: number;
}
